Data Exploration üîç
A COVID-19 Survey on Alcohol Consumption
A survey has been done to examine the impact of COVID-19 on people‚Äôs mental health and alcohol consumption in 21 European countries between April to July 2020 after COVID-19 hit Europe. Figure 4 shows the responses of 808 Swedes who participated in the survey and how they find the current situation of the spread of COVID-19. They were divided into 3 age groups, 18-34 years, 35-54 years and 55-98 years. As it can be seen from the graph, approximately 60% of the people from each group found the pandemic stressful, and this is not surprising. And you would probably think that this may cause an increase in alcohol consumption as people would turn to alcohol to cope with the stress.
However, Figure 5 tells a different story. Compare to some of the European countries like United Kingdom, Ireland, Denmark, the Swedes seemed to consume less alcohol during the pandemic, with the majority of the people did not change their drinking habits and people who drink less were in the second largest group, only a small proportion of people consuming more alcohol. This pattern was more obvious in the younger cohorts, there was a large proportion of people who are aged between 18-24 years consume less more alcohol than the other age groups (see Figure 6). The restrictions implemented by the Swedish government have greatly reduced social gatherings where alcohol consumption usually was expected and often pressured to happen, and this is the reason for the reduction of alcohol use among the younger cohorts as they generally consume more alcohol in social events (Movendi, 2020). A research also found that during March - April 2020, alcohol consumption among Swedish adults and youth is the lowest in the EU (Nordic Alcohol and Drug Policy Network, n.d).
In contrast, there were quite a lot of people in the other 3 countries consumed more alcohol than pre-pandemic, especially in United Kingdom and Ireland, the most popular answer was ‚Äúslightly more‚Äù and it was the second most answer for Denmark. One possible explanation for this diverging patterns could be the less restrict alcohol policies in the United Kingdom, the U.K government declares alcohol shops are essential businesses (Forbes, 2020), whereas in Sweden, there are more restrictive alcohol policies in place, such as, alcohol can only be purchased from a government owned liquor store and alcohol ban after 10pm etc.



