Current COVID-19 Situation in Sweden
New Confirmed Cases and Deaths
Sweden has recorded three waves so far, the two major ones were in the late 2020 to early 2021 and March to June this year and the number of confirmed cases per million people were the highest among its neighbouring countries, Germany, Norway, Denmark and Finland, as shown in the Figure 7. The main reason for this would be the Swedish government‚Äôs soft touch approach on dealing with the virus among the European countries, it has drawn worldwide attention and criticism, even scientists called for changes to their covid strategy (ABC news, 2020), and when the third wave hit, Sweden had already opted against lock downs, face masks, instead relying on mostly voluntary measures (Reuters, 2021). The graph also shows the numbers are rising again since July this year, but the increase in confirmed cases is not yet significant, let‚Äôs hope the vaccination can be of assistance in flatting the curve.
Furthermore, we can also see from Figure 7 that the daily number of deaths per million people in Sweden seems relatively low in comparison with its daily cases, but this could be deceiving. If we take the daily numbers and calculate the cumulative sum of deaths, Sweden again, is well above its neighbours. Its death toll has been increasing drastically than other countries since the beginning of the pandemic, see Figure 8. For a country that only have 10 million population, one-eight of the population in Germany, this is very concerning. Watch a video about Swedish COVID strategy below.








