Figure 10: Accumulative Vaccines Administered



Sweden‚Äôs vaccine roll out consists of 4 phases, phase 1 is for people who live in care homes for elderly, who have at-home care and who live with home, phase 2 is for people who are aged 65-69, phase 3 is for people are aged 60-64 and phase 4 is for other adults aged 18-59, oldest first (The Local, 2021). Figure 11 shows the timeline of fully vaccinate people in each age group, I calculated the cumulative sum of the weekly numbers, so it shows a trend of how the vaccination roll out progresses. As it can be seen from the graph, the seniors groups were vaccinated first followed by the younger groups. A Stockholm based research shows that the effects of vaccinating two of the most vulnerable groups in Sweden successfully reduced the infection rates and deaths (Mestrovic, 2021). This has proved again that vaccination is definitely effective at helping protest against the virus.

Figure 11: hover over to see the accumulative weekly number of fully vaccinated number for each age group.






